import React, { Component } from 'react';
import styled from "styled-components";

const square = styled.square`
  background-color: #f00;
`;

class Cell extends Component {
  render() {
    return (
      <div>
        <div class="row0">
          <square id="0" onclick="changeColor(this)" class="square"></square>
          <square id="1" onclick="changeColor(this)" class="square"></square>
          <square id="2" onclick="changeColor(this)" class="square"></square>
        </div>
        <div class="row1">
          <square id="3" onclick="changeColor(this)" class="square"></square>
          <square id="4" onclick="changeColor(this)" class="square"></square>
          <square id="5" onclick="changeColor(this)" class="square"></square>
        </div>
        <div class="row2">
          <square id="6" onclick="changeColor(this)" class="square"></square>
          <square id="7" onclick="changeColor(this)" class="square"></square>
          <square id="8" onclick="changeColor(this)" class="square"></square>
        </div>
      </div>  
    )
  }
}

export default Cell;
